import React from "react";
import './css/bioStyle.css'
export default function Bio() { 
    return(
        <section class="team-bio">
  <h2>Meet Our Team</h2>
  <div class="bio-content">
    <p>Welcome to <span class="store-name">MATALAN</span>, where we believe that shopping should be an experience. Our team is made up of passionate individuals who are dedicated to bringing you the best products and services. We are a tight-knit group of experts who pride ourselves on our attention to detail, knowledge of the industry, and commitment to providing exceptional customer service.</p>
    <p>Our team is made up of experienced professionals with a wide range of backgrounds and expertise. From fashion and design to marketing and sales, we have the skills necessary to help you find exactly what you need. We take the time to get to know our customers and understand their unique needs, ensuring that they leave our store feeling satisfied and confident in their purchase.</p>
    <p>At <span class="store-name">MATALAN</span>, we are more than just a store - we are a community. We believe in building lasting relationships with our customers and creating a welcoming environment where everyone feels at home. Whether you're looking for the latest trends or timeless classics, our team is here to help you every step of the way.</p>
    <p>Thank you for choosing <span class="store-name">MATALAN</span>. We look forward to serving you!</p>
  </div>
</section>
    )
}
